FROM 
	posts p,users u 
where
    p.user_id = u.id 
    AND p.del_status = 1
    
    
	
	
    AND NOT FIND_IN_SET(\'41\',p.hide) <> 0
    ORDER BY p.id DESC LIMIT 10, 19 '
